/**
 * @param {number[][]} grid
 * @return {boolean}
 */
var hasValidPath = function(grid) {
    //const l=1,r=2,u=3,d=4;
    const fromTo = {
        1:['l','r'],
        2:['u','d'],
        3:['l','d'],
        4:['r','d'],
        5:['u','l'],
        6:['u','r']
    }
    const dir = {
        l:'r',r:'l',u:'d',d:'u'
    }
    const m = grid.length;
    const n = grid[0].length;
    
    function loop(from,x,y) {
        while(true){
            if(x<0 || y < 0 || x >=m||y>=n){
                return false;
            }
            const cur = grid[x][y];
            const ft = fromTo[cur];
            if(!ft.includes(from)){
                return false;
            }
            if(x==m-1 && y == n-1){
                return true;
            }
            const nextTo = ft[0] == from ? ft[1]:ft[0];
            const nextDir = dir[nextTo];
            let nextX,nextY;
            switch(nextTo){
                case 'l':
                    nextX=x;
                    nextY=y-1;
                    break;
                case 'r':
                    nextX=x;
                    nextY=y+1;
                    break;
                case 'u':
                    nextX=x-1;
                    nextY=y;
                    break;
                case 'd':
                    nextX=x+1;
                    nextY=y;
                    break;
            }
            from = nextDir;
            x = nextX;
            y = nextY;
        }
    }
    const start = grid[0][0];
    let ft = fromTo[start];
    let ret = loop(ft[0],0,0)
    if(ret==false){
        return loop(ft[1],0,0)
    }
    return ret
};

